import React, { useState } from "react";

const Inputs = (props) => {

	const [ checked, setChecked ] = useState(false)

	const inputdisabled = (e) => {
		if(checked(true)){
			setChecked(false)
		}else if(checked(false)){
			setChecked(true)
		}
	}

	return (
		<div>
			<p>Texto del input</p>
			<label htmlFor={props.id}>Input de prueba</label>
			<input
			onClick={inputdisabled} 
			type="checkbox" 
			/>
			<input 
			className={props.clName} 
			type="text" 
			id={props.id} 
			name={props.name} disabled={checked}/>

		</div>
	);
};

export default Inputs;
